import React, {useEffect, useState} from "react";
import {Link, useHistory, useParams} from "react-router-dom";
import {deleteCard, deleteDeck, readDeck} from "../utils/api/index";

function Deck() {
    const history = useHistory();
    const params = useParams();

    const [newDeck, setNewDeck] = useState(null);
    const [newCards, setNewCards] = useState(null);

    useEffect(() => {
        async function loadDecks() {
            try {
                const response = readDeck(params.deckId)
                setNewDeck(response);
                const cards = readDeck(params.deckId.cards)
                setNewCards(cards);
            } catch (error) {
                console.log(error);
            }
        }
    }, [params])
}

export default Deck;
